import React from "react";
import { Card } from "../../UI/Card.styled";
import { ImageCard } from "../../UI/ImageCard.styled";

const SectionOne = ({ UI, colors }) => {
  const job = "Oje Paul";
  return (
    <>
      <Card
        mg={"4rem 3rem"}
        height={"12rem"}
        dp={"grid"}
        gridC={"60% 40%"}
        bd={"1px solid red"}
      >
        <Card bd={"1px solid red"}>
          <Card height={"80%"} mg={"5% 0%"} bd={"1px solid red"}>
            <Card cl={colors.h3} fw={"700"} fs={"0.6rem"}>
              Welcome to my portfolio website!
            </Card>
            <Card
              //   mg={"1rem 0 0 0"}
              fw={"700"}
              fs={"1.5rem"}
            >{`Hey Folks,i'm ${job}`}</Card>
          </Card>
          <Card fs={"0.3rem"}>
            Building a successful product is a challenge. I am highly energetic
            in user experience design, interfaces and web development.
          </Card>
        </Card>
        <Card bd={"1px solid red"}>
          <ImageCard height={"100%"} width={"100%"} src={UI.Engineer} />
        </Card>
      </Card>
    </>
  );
};

export default SectionOne;
